import React from 'react';
import './global.css';
import Routes from './routes';
import { GlobalStyle } from "./styles/global";
import logo from './logo.svg';

function App() {
  return (
    <>
    <img src={logo} className="App-logo" alt="logo" />
    <Routes />
    <GlobalStyle />
    </>
  );
}
export default App;
